import styled from "styled-components";

const HeaderContainer = styled.div`
  z-index: 1;
  color: #fff;
  min-width: 130px;
  min-height: 34px;
  display: flex;
  font-size: 15px;
  align-items: center;
  border-radius: 40px;
  background: #1c4491;
  font-family: sans-serif;
  justify-content: center;
  box-shadow: inset #00000050 0px -9px 11px 0px;
  position: relative;
  top: 15px;
`;
export { HeaderContainer };
